import React from "react";



function Card(props){

    return(
        <>
        <div className="cards">
            <div className="card">
                {/* <Images imgsrc={props.imgsrc}/> */}
                <div className="card__info">
                    <span className="card__category">{props.title}</span>
                    {/* <Heading sname={props.sname} /> */}
                    <a href={props.link} target="_blank">
                    <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
        </>
    )
}



export default Card;
